export type BlocktypeCode = string
export type BuildingType = 'flats' | 'house'
// export type UnitMix = 0 | 1 | 2 // unit size priority: 0 = small, 1 = equal, 2 = large
export type Stairs = 1 | 2
export type FloorPlate = 'single-loaded' | 'double-loaded'

type Entries<T> = Array<
  {
    [K in keyof T]: [K, T[K]]
  }[keyof T]
>
const getEntries = <T extends object>(obj: T): Entries<T> => Object.entries(obj) as Entries<T>

export class Blocktypes {
  blocktypes: Record<string, HouseBlocktype>
  storeysConstraint?: number = undefined
  bedroomsConstraint?: number = undefined

  constructor(blocktypes: Record<string, HouseBlocktype>) {
    this.blocktypes = blocktypes
  }

  resetConstraints(): void {
    this.storeysConstraint = undefined
    this.bedroomsConstraint = undefined
  }

  count(): number {
    return Object.keys(this.filteredBlocktypes()).length
  }

  filterByBedrooms(numBedrooms: number): Record<string, HouseBlocktype> {
    return Object.fromEntries(getEntries(this.blocktypes).filter(([k, v]) => v.bedrooms === numBedrooms))
  }

  filterByStoreys(numStoreys: number): Record<string, HouseBlocktype> {
    return Object.fromEntries(getEntries(this.blocktypes).filter(([k, v]) => v.storeys === numStoreys))
  }

  filteredBlocktypes(): Record<string, HouseBlocktype> {
    let filtered = this.blocktypes

    if (this.bedroomsConstraint != null) {
      filtered = Object.fromEntries(getEntries(filtered).filter(([k, v]) => v.bedrooms === this.bedroomsConstraint))
    }

    if (this.storeysConstraint != null) {
      filtered = Object.fromEntries(getEntries(filtered).filter(([k, v]) => v.storeys === this.storeysConstraint))
    }

    return filtered
  }

  validStoreys(): number[] {
    let filtered = this.blocktypes
    if (this.bedroomsConstraint != null) {
      filtered = this.filterByBedrooms(this.bedroomsConstraint)
    }
    if (Object.values(filtered).map((b) => b.storeys).length === 0) {
      debugger
    }
    return Array.from(new Set(Object.values(filtered).map((b) => b.storeys))).sort((a, b) => a - b)
  }

  minStoreys(): number {
    const result = Math.min(...this.validStoreys())
    // if (!Number.isFinite(result)) {
    //   debugger
    // }
    return result
  }

  maxStoreys(): number {
    return Math.max(...this.validStoreys())
  }

  validBedrooms(): number[] {
    let filtered = this.blocktypes
    if (this.storeysConstraint != null) {
      filtered = this.filterByStoreys(this.storeysConstraint)
    }
    return Array.from(new Set(Object.values(filtered).map((b) => b.bedrooms))).sort((a, b) => a - b)
  }

  minBedrooms(): number {
    return Math.min(...this.validBedrooms())
  }

  maxBedrooms(): number {
    return Math.max(...this.validBedrooms())
  }

  constrainStoreys(storeys?: number): void {
    this.storeysConstraint = storeys
  }

  constrainBedrooms(bedrooms?: number): void {
    this.bedroomsConstraint = bedrooms
  }
}

export interface BaseBlocktype {
  code: BlocktypeCode
  name: string
  grossInternalArea: number
  grossExternalArea: number
  imageWidth: number
  imageHeight: number
  dualAspectUnitPercentage?: number
  footprintWidth?: number
  footprintDepth?: number
  noBuildWidth?: number
  noBuildDepth?: number
}

export interface FlatsBlocktype extends BaseBlocktype {
  buildingType: 'flats'
  studios: number
  oneBedUnits: number
  twoBedUnits: number
  threeBedUnits: number
  fourBedUnits: number
  units: number
  numberDualAspect: number
  stairs: Stairs
  loaded: FloorPlate
}

export interface HouseBlocktype extends BaseBlocktype {
  buildingType: 'house'
  bedrooms: number
  storeys: number
  dualAspectUnitPercentage: 1
  numberDualAspect: 1
}

export type Blocktype = FlatsBlocktype | HouseBlocktype

export type BlocktypeList = Record<BlocktypeCode, FlatsBlocktype | HouseBlocktype>

const first = (str: string): string => str.charAt(0).toUpperCase()

const isFlats = (blocktype: Blocktype): blocktype is FlatsBlocktype => {
  return blocktype.buildingType === 'flats'
}

export const getMixTypes = (
  type: BuildingType,
  floorPlate: FloorPlate,
  stairs: number,
): number[][] => {
  const matchingBlocks = Object.entries(blocktypes).filter(
    ([code, blocktype]) =>
      isFlats(blocktype) &&
      code.startsWith(`${first(type)}_${first(floorPlate)}_${stairs}`),
  ) as Array<[string, FlatsBlocktype]>

  const result = matchingBlocks
    // .sort(([_a, blockA], [_b, blockB]) => blockA.unitMix - blockB.unitMix)
    .map(([_, block]) => {
      return [block.studios ?? 0, block.oneBedUnits ?? 0, block.twoBedUnits ?? 0, block.threeBedUnits ?? 0]
    })

  return result
}

